import React from 'react';
import {ItemSong} from './'

const ListSong = (props) => {
    const {songs,totalDuration } = p
    return (
        <div className='w-full flex flex-col py-[10]'>
            <div className='flex justify-between items-center text-xs p-[10px] text-main-100 font-semibold'>
                <span>BÀI HÁT</span>
                <span>ALBUM</span>
                <span>THỜI GIAN</span>
            </div>
            <div className='flex flex-col'>
                {songs?.map(item =>(
                <ItemSong 
                key={item.encodeId}
                songData= {item}
                />
                ))}
            </div>
        </div>
    );
}

export default ListSong;
